import { useState } from "react";
import { DeleteImg } from "../locales/images/delete";
import { SearchImg } from "../locales/images/search";
import { StartSearchImg } from "../locales/images/startSearch";
import { Filter } from "../models/Filter";
import { CircleBox, CircleBoxHiddenHandle, SearchMain } from "../styles/Header";
import { Filters } from "./Filters";
import { SearchBar } from "./SearchBar";
export const Search = ({ filter, setFilter }: any) => {
  const [isOpen, setIsOpen] = useState();
  return (
    <SearchMain>
      <CircleBox>
        <SearchImg />
        <CircleBoxHiddenHandle></CircleBoxHiddenHandle>
      </CircleBox>
      <SearchBar></SearchBar>
      <Filters
        filter={filter}
        setFilter={setFilter}
        showList={isOpen}
        setShowList={setIsOpen}
      ></Filters>
    </SearchMain>
  );
};
